<h2>SSCAIT 2015/16</h2>
<div>
   The 2015/16 installment of SSCAIT sported 46 participants. The tournament was divided into two divisions:
   <ul>
      <li><b>Student division</b>: Round Robin tournament of 1035 games, where everybody played one game against everybody else. 
         Only the students were eligible for prizes.
      <li><b>Mixed division</b>: Elimination bracket of 16 best bots (including non-students and teams).
   </ul>
</div>
